CREATE MATERIALIZED VIEW public.mv_market_price_aggregates_by_date AS
 SELECT dd.date,
    dc.commodity,
    dcn.county,
    round(avg(fmp.wholesale_price), 2) AS avg_wholesale_price,
    round(avg(fmp.retail_price), 2) AS avg_retail_price,
    sum(fmp.supply_volume) AS total_supply_volume
   FROM (((public.fact_market_prices fmp
     JOIN public.dim_date dd ON ((fmp.date_sk = dd.id)))
     JOIN public.dim_commodity dc ON ((fmp.commodity_sk = dc.id)))
     JOIN public.dim_county dcn ON ((fmp.county_sk = dcn.id)))
  GROUP BY dd.date, dc.commodity, dcn.county
  ORDER BY dc.commodity
  WITH NO DATA;


