CREATE MATERIALIZED VIEW public.mv_month_over_month_price_changes AS
 WITH lagged_prices AS (
         SELECT dd.date,
            dc.commodity,
            dm.market,
            date_part('year'::text, dd.date) AS year,
            date_part('month'::text, dd.date) AS month,
            fmp.wholesale_price,
            fmp.retail_price,
            lag(fmp.wholesale_price) OVER (PARTITION BY fmp.commodity_sk, fmp.grade_sk, fmp.market_sk ORDER BY dd.date) AS lagged_wholesale_price,
            lag(fmp.retail_price) OVER (PARTITION BY fmp.commodity_sk, fmp.grade_sk, fmp.market_sk ORDER BY dd.date) AS lagged_retail_price
           FROM (((public.fact_market_prices fmp
             JOIN public.dim_date dd ON ((fmp.date_sk = dd.id)))
             JOIN public.dim_commodity dc ON ((fmp.commodity_sk = dc.id)))
             JOIN public.dim_market dm ON ((fmp.market_sk = dm.id)))
        )
 SELECT lagged_prices.date,
    lagged_prices.commodity,
    lagged_prices.market,
    lagged_prices.year,
    lagged_prices.month,
    lagged_prices.wholesale_price,
    lagged_prices.retail_price,
    round(((lagged_prices.wholesale_price - lagged_prices.lagged_wholesale_price) / lagged_prices.lagged_wholesale_price), 2) AS wholesale_price_change_mom,
    round(((lagged_prices.retail_price - lagged_prices.lagged_retail_price) / lagged_prices.lagged_retail_price), 2) AS retail_price_change_mom
   FROM lagged_prices
  WHERE ((lagged_prices.lagged_wholesale_price IS NOT NULL) AND (lagged_prices.lagged_retail_price IS NOT NULL))
  ORDER BY lagged_prices.commodity
  WITH NO DATA;


